    false,nt"url": null,nt"notes": "This annual narrative report for Aleutian
    Islands and Izembek NWRs outlines Refuge accomplishments during the 1966 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, and
    raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. Resource management is outlined; topics include
    grazing and commercial fishing. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    Refuge visitors, hunting, and safety. Items of interest, N-R forms, and an article
    title "Raising Caribou for an Aleutian Introduction" and "The Process of family
    disintegration in Black Brant" are attached.",nt"license_title": "License
